/* mmaMIDItoAtten()
calculates the raw attenuation according to MMA DLS spec
midiValue = the MIDI (0 -> 127) value to convert
*/
inline double mmaMIDItoAtten(unsigned int midiValue)
{
	if (midiValue == 0)
		return 0.0; // --- floor

	return ((double)midiValue*(double)midiValue) / (127.0*127.0);
}

/* calculatePanValues()
calculates the left and right pan values
dPanMod = bipolar (-1 -> 1) pan modulation value
returns are via pass-by-reference mechanism
*/
inline void calculatePanValues(double bipolarModulator, double& leftPanValue, double& rightPanValue)
{
	leftPanValue = cos((kPi / 4.0)*(bipolarModulator + 1.0));
	rightPanValue = sin((kPi / 4.0)*(bipolarModulator + 1.0));

	leftPanValue = fmax(leftPanValue, (double)0.0);
	leftPanValue = fmin(leftPanValue, (double)1.0);
	rightPanValue = fmax(rightPanValue, (double)0.0);
	rightPanValue = fmin(rightPanValue, (double)1.0);
}

// --- quasi-random noise gnerator
inline double doPNSequence(uint32_t& uPNRegister)
{
	// --- get the bits
	uint32_t b0 = EXTRACT_BITS(uPNRegister, 1, 1); // 1 = b0 is FIRST bit from right
	uint32_t b1 = EXTRACT_BITS(uPNRegister, 2, 1); // 1 = b1 is SECOND bit from right
	uint32_t b27 = EXTRACT_BITS(uPNRegister, 28, 1); // 28 = b27 is 28th bit from right
	uint32_t b28 = EXTRACT_BITS(uPNRegister, 29, 1); // 29 = b28 is 29th bit from right

													 // --- form the XOR
	uint32_t b31 = b0^b1^b27^b28;

	// --- form the mask to OR with the register to load b31
	if (b31 == 1)
		b31 = 0x10000000;

	// --- shift one bit to right
	uPNRegister >>= 1;

	// --- set the b31 bit
	uPNRegister |= b31;

	// --- convert the output into a floating point number, scaled by experimentation
	// --- to a range of o to +2.0
	float fOut = (float)(uPNRegister) / ((pow((float)2.0, (float)32.0)) / 16.0);

	// --- shift down to form a result from -1.0 to +1.0
	fOut -= 1.0;

	return fOut;
}

/**
\struct SynthRenderData
\ingroup SynthStructures
\brief Structure for rendering audio in an ISynthComponent
*/
struct SynthProcessorData
{
	SynthProcessorData() {}

	// --- fast clearing of array
	void clear() {
		memset(inputs, 0, MAX_SYNTH_CHANNELS * sizeof(double));
		memset(outputs, 0, MAX_SYNTH_CHANNELS * sizeof(double));
	}

	// --- array of outputs; for stereo 0 = LEFT and 1 = RIGHT
	double inputs[MAX_SYNTH_CHANNELS] = { 0.0 };

	// --- array of outputs; for stereo 0 = LEFT and 1 = RIGHT
	double outputs[MAX_SYNTH_CHANNELS] = { 0.0 };

	// --- count, set by the voice that renders to let the engine know how many outputs are real
	unsigned int numInputChannels = 0; // the active number of channels starting with channel[0]
	unsigned int numOutputChannels = 0; // the active number of channels starting with channel[0]
};


/**
\struct ModInputData
\ingroup SynthStructures
\brief Structure for implementing the IModulationInput interface
*/
struct ModInputData
{
	ModInputData() { init(); }
	ModInputData& operator=(const ModInputData& modulators)	// need this override for collections to work
	{
		if (this == &modulators)
			return *this;

		// --- bulk memory block copy (fast)
		memcpy(&modulationInputs[0], &modulators.modulationInputs[0], MAX_MODULATION_CHANNELS * sizeof(double));

		modInputCount = modulators.modInputCount;

		return *this;
	}

	// --- fast clearing of array
	void clear() {
		memset(modulationInputs, 0, MAX_MODULATION_CHANNELS * sizeof(double));
	}

	// --- set defaults to avoid accidental note-off state
	void init() {
		modulationInputs[kEGMod] = 1.0;
		modulationInputs[kAmpMod] = 1.0;
		modulationInputs[kMaxDownAmpMod] = 1.0;
	}

	// --- for modulation matrix to have instant access to the input array
	double* getModuationInputPtr(unsigned int index) {
		if (index < MAX_MODULATION_CHANNELS)
			return &modulationInputs[index];
		return nullptr;
	}

	// --- array of inputs; for stereo 0 = LEFT and 1 = RIGHT
	double modulationInputs[MAX_MODULATION_CHANNELS] = { 0.0 };

	// --- count, set by the voice that renders to let the engine know how many outputs are real
	unsigned int modInputCount = 0; // the active number of mod inputs starting with channel[0]
};

/**
\struct ModOutputData
\ingroup SynthStructures
\brief Structure for implementing the IModulationInput interface
*/
struct ModOutputData
{
	ModOutputData() {}
	ModOutputData& operator=(const ModOutputData& modulators)	// need this override for collections to work
	{
		if (this == &modulators)
			return *this;

		// --- bulk memory block copy (fast)
		memcpy(&modulationOutputs[0], &modulators.modulationOutputs[0], MAX_MODULATION_CHANNELS * sizeof(double));

		modOutputCount = modulators.modOutputCount;

		return *this;
	}

	// --- fast clearing of array
	void clear() {
		memset(modulationOutputs, 0, MAX_MODULATION_CHANNELS * sizeof(double));
	}

	// --- array of outputs
	double modulationOutputs[MAX_MODULATION_CHANNELS] = { 0.0 };

	// --- count, set by the voice that renders to let the engine know how many outputs are real
	unsigned int modOutputCount = 0; // the active number of mod inputs starting with channel[0]
};

