/**
\struct msecToSamples
\ingroup SynthDefs
\brief convert milliseconds to samples
*/
inline double msecToSamples(double sampleRate, double timeMSec)
{
	return sampleRate*(timeMSec / 1000.0);;
}


/**
\struct boundMIDIValueByte
\ingroup SynthDefs
\brief Bound a value to min and max limits
*/
inline void boundMIDIValueByte(unsigned int& value)
{
	value = fmin(value, 127);
	value = fmax(value, 0);
}


