/**
\struct XHoldFader
\ingroup SynthStructures
\brief A structure that implements a simple crossfade operation
*/
struct XHoldFader
{
public:
	XHoldFader() {}
	XHoldFader(double _sampleRate, double _xfadeTime_mSec)
	{
		sampleRate = _sampleRate;
		xfadeTime_mSec = _xfadeTime_mSec;
	}

	// --- fader functions
	void reset() { xfadeTime_Counter = 0; holdTime_Counter = 0; }

	void setSampleRate(double _sampleRate) { sampleRate = _sampleRate; updateXFadeTime(); updateHoldTime(); }		///< reset the counter
	void setXFadeTime_mSec(double _xfadeTime_mSec) { xfadeTime_mSec = _xfadeTime_mSec; updateXFadeTime(); updateHoldTime(); }
	void setPureXfade(bool _pureCrossfade) { pureCrossfade = _pureCrossfade; }		///< reset the counter

	void setSourceHoldTime_mSec(double _holdTime_mSec)
	{
		holdTime_mSec = _holdTime_mSec;
		updateHoldTime();
	}

	// --- crossfade FROM A to B
	bool processInputChannels(double inputA, double inputB, double& output)
	{
		if (!pureCrossfade && (holdTime_Counter < holdTime_Samples))
		{
			output = inputA;
			holdTime_Counter++;
			return false;
		}
		else // do crossfade
		{
			if (pureCrossfade && xfadeTime_Samples == 0)
			{
				output = inputA;
				holdTime_Counter++;
				return false;
			}

			double x = (double)xfadeTime_Counter / (double)xfadeTime_Samples;

			// --- if we just rolled over:
			if (x >= 1.0)
			{
				// --- output is all B now
				output = inputB;

				xfadeTime_Counter = 0;
				holdTime_Counter = xfadeTime_Counter;
				return true; // done
			}

			// --- calculate gains
			output = inputA*(1.0 - x*x) + inputB*(1.0 - (x - 1.0)*(x - 1.0)); // A gain = 1 - x^2, B gain = 1 - ((x-1)^2)
			xfadeTime_Counter++;
			holdTime_Counter++;

			return false;
		}
	}

protected:
	double sampleRate = 44100;
	double xfadeTime_mSec = 100.0;
	uint32_t xfadeTime_Samples = 4410;
	uint32_t xfadeTime_Counter = 0;

	double holdTime_mSec = 1000.0;
	uint32_t holdTime_Samples = 4410;
	uint32_t holdTime_Counter = 0;

	bool pureCrossfade = false;

	void updateHoldTime()
	{
		// --- time = hold time - half the xfade time (or the A xfade time for asymmetry later)
		holdTime_Samples = uint32_t(((holdTime_mSec*sampleRate) / 1000.0));
		if (holdTime_Samples < 2 * xfadeTime_Samples)
			holdTime_Samples = 0;

		holdTime_Samples = uint32_t(((holdTime_mSec*sampleRate) / 1000.0)) - (xfadeTime_Samples / 2);
	}
	void updateXFadeTime()
	{
		xfadeTime_Samples = uint32_t(((xfadeTime_mSec*sampleRate) / 1000.0));
	}
};

/**
\struct SlewLimiter
\ingroup SynthStructures
\brief A structure the implements a simple 1-pole LPF to use as a slew-limiter
*/
struct SlewLimiter
{
public:
	SlewLimiter() {}

	// --- slewing functions
	void reset() { z1 = 0; }		///< reset the counter

									// --- slew value is:  0 <= slewvalue <= 0.9999
	void setSlewValue(double _g) { g = _g; }		///< reset the counter
	double doSlewLimiter(double input)
	{
		double output = input*(1.0 - g) + g*z1;
		z1 = output;
		return output;
	}

protected:
	double g = 0;
	double z1 = 0.0;
};


/**
\struct XHoldFader
\ingroup SynthStructures
\brief A structure that implements a simple crossfade operation
*/
struct XFader
{
public:
	XFader() {}
	XFader(double _xfadeTime_Samples)
	{
		xfadeTime_Samples = _xfadeTime_Samples;
	}

	// --- fader functions
	void reset() { xfadeTime_Counter = 0; }

	void setXFadeTime(double _xfadeTime_Samples)
	{
		xfadeTime_Samples = _xfadeTime_Samples;
	}
	
	// --- crossfade FROM A to B
	//     returns TRUE if the crossfade is still going (needs more samples)
	//			   FALSE if the crossfade is finished (done)
	bool crossfade(XFadeType xfadeType, double inputA, double inputB, double& output)
	{
		double x = (double)xfadeTime_Counter / (double)xfadeTime_Samples;

		// --- if we just rolled over:
		if (x >= 1.0)
		{
			// --- output is all B now
			output = inputB;
			xfadeTime_Counter = 0;
			return false;
		}

		// --- calculate gains
		if (xfadeType == XFadeType::kConstantPower)
			output = inputA*(1.0 - x*x) + inputB*(1.0 - (x - 1.0)*(x - 1.0)); // A gain = 1 - x^2, B gain = 1 - ((x-1)^2)
		else //  linear
			output = inputA*(1.0 - x) + inputB*(x); 

		xfadeTime_Counter++;
		return true; // still need xfade
	}

protected:
	uint32_t xfadeTime_Samples = 4410;
	uint32_t xfadeTime_Counter = 0;
};

/**
\struct XHoldFader
\ingroup SynthStructures
\brief A structure that implements a simple crossfade operation
*/
struct GlideModulator
{
public:
	GlideModulator() {}
	~GlideModulator() {}

	// --- setup the timer and incrementer
	bool start(uint32_t _startMIDINote, uint32_t _endMIDINote, double glideTime_mSec, double sampleRate)
	{
		// --- we don't really need to store these?
		startMIDINote = _startMIDINote;
		endMIDINote = _endMIDINote;

		if (startMIDINote == endMIDINote || glideTime_mSec <= 0.0)
		{
			timerActive = false;
			return false;
		}

		semitones = (double)startMIDINote - (double)endMIDINote;
		countDownTimer = 1.0;
		timerInc = (1000.0 / glideTime_mSec) / sampleRate;
		timerActive = true;
		return true;
	}

	// --- get next value, decrement counter
	double getNextGlideModSemitones()
	{
		double output = 0.0;
		if (timerActive)
		{
			output = countDownTimer*semitones;

			countDownTimer -= timerInc;
			if (countDownTimer <= 0.0)
				timerActive = false;
		}
		return output;
	}

protected:
	bool timerActive = false;
	double timerInc = 0.0;
	double countDownTimer = 1.0;
	double semitones = 1.0;
	uint32_t startMIDINote = 0;
	uint32_t endMIDINote = 0;
};




