	void clear() {
		memset(synthOutputs, 0, MAX_SYNTH_CHANNELS * sizeof(double));
	}

	// --- array of outputs; for stereo 0 = LEFT and 1 = RIGHT
	double synthOutputs[MAX_SYNTH_CHANNELS] = { 0.0 };

