// --- for wave sample data sources so they can be shared
class WaveData;
enum class SampleLoopMode;

class IWaveSample
{
public:
	// --- open a folder and parse the WAV files, up to 128 of them
	virtual void createWaveSamples(std::string sampleFolder, SampleLoopMode _loopMode) = 0;

	// --- select a wave data object nased on oscillator frequency
	virtual const WaveData* selectWaveSample(double oscillatorFrequency, uint32_t& midiNoteNumber) = 0;
	
	// --- get the mode for this loop (see WaveData class)
	virtual SampleLoopMode getLoopMode() = 0;

	// --- number of total samples in the folder
	virtual uint32_t getWaveSampleCount() { return 0; }
};


struct OscillatorOutputData
{
	OscillatorOutputData() {}

	void clear() {
		memset(outputs, 0, MAX_OSC_CHANNELS * sizeof(double));
	}

	double outputs[MAX_OSC_CHANNELS] = { 0.0 };
};

// --- for a generic modulator object
class ISynthModulator
{
	// --- reset()
	//     Sample rate may or may not be required, but usually is
	virtual bool reset(double _sampleRate) = 0;
	virtual bool update(bool updateAllModRoutings = true) = 0;

	// --- note event handlers
	virtual bool doNoteOn(double midiPitch, uint32_t midiNoteNumber, uint32_t midiNoteVelocity) = 0;
	virtual bool doNoteOff(double midiPitch, uint32_t midiNoteNumber, uint32_t midiNoteVelocity) = 0;

	// --- access to modulators
	virtual std::shared_ptr<ModInputData> getModulators() = 0;
	virtual void setModulators(std::shared_ptr<ModInputData> _modulators) = 0;

	// --- render modulation output
	virtual const ModOutputData renderModulatorOutput() = 0;
};

// --- **7**
class ISynthOscillator
{
	// --- reset()
	//     Sample rate may or may not be required, but usually is
	virtual bool reset(double _sampleRate) = 0;
	virtual bool update(bool updateAllModRoutings = true) = 0;

	// --- banks
	virtual std::vector<std::string> getWaveformNames(uint32_t bankIndex) = 0;
	virtual std::vector<std::string> getBankNames() = 0;
	virtual void setBankSet(uint32_t _bankSet) { }
	virtual uint32_t getBankSet() { return 0; }

	// --- note event handlers
	virtual bool doNoteOn(double midiPitch, uint32_t midiNoteNumber, uint32_t midiNoteVelocity) = 0;
	virtual bool doNoteOff(double midiPitch, uint32_t midiNoteNumber, uint32_t midiNoteVelocity) = 0;

	// --- for glide modulation
	virtual bool setGlideModulation(uint32_t _startMIDINote, uint32_t _endMIDINote, double glideTime_mSec) = 0;

	// --- access to modulators
	virtual std::shared_ptr<ModInputData> getModulators() = 0;
	virtual void setModulators(std::shared_ptr<ModInputData> _modulators) = 0;

	// --- render audio output
	virtual const OscillatorOutputData renderAudioOutput() = 0;

	// --- for hard-sync (optional)
	virtual void hardSyncReset(double subSamplesPostWrap) { }
};

// --- this is a combination of ISynthOscillator + IAudioSignalProcessor
class ISynthProcessor
{
	// --- reset()
	//     Sample rate may or may not be required, but usually is
	virtual bool reset(double _sampleRate) = 0;
	virtual bool update(bool updateAllModRoutings = true) = 0;

	// --- note event handlers
	virtual bool doNoteOn(double midiPitch, uint32_t midiNoteNumber, uint32_t midiNoteVelocity) = 0;
	virtual bool doNoteOff(double midiPitch, uint32_t midiNoteNumber, uint32_t midiNoteVelocity) = 0;

	// --- switch to enable.disable the aux input
	virtual void enableAuxInput(bool enableAuxInput) {}

	// --- the process function; note that synth voices can have up to 32 channels of output
	//     so we use a new structure here rather than the older frame processing
	virtual bool processSynthAudio(SynthProcessorData* audioData) = 0;

	// --- for processing objects with a sidechain input or other necessary aux input
	//     the return value is optional and will depend on the subclassed object
	virtual double processAuxInputAudioSample(double xn) { return xn; }

	// --- access to modulators
	virtual std::shared_ptr<ModInputData> getModulators() = 0;
	virtual void setModulators(std::shared_ptr<ModInputData> _modulators) = 0;
};



